script: |
  super -f text -I q5747.spq | sort > q5747.out

inputs:
  - name: q5747.spq
    data: |
      SELECT DISTINCT + col1, + 64 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col2 * - 67 * + 54 * + col0 BETWEEN - col1 * 43 AND NULL;
  - name: tab0

outputs:
  - name: q5747.out
    data: |
      1	64
      21	64
      81	64
